import React from "react";
import "./styles/global.css";
import Accordion from "./UI/1-atoms/Accordion";

const Accord = [
  {
    title: "Install Clario",
    content: "Relax and let Clario do the job.",
    id: "Clario1",
  },
  {
    title: "Set up your protection",
    content: "Relax and let Clario do the job.",
    id: "Clario2",
  },
  {
    title: "Enjoy spy-free life",
    content: "Relax and let Clario do the job.",
    id: "Clario3",
  },
];

function App() {
  return (
    <div className={"max-w-[320px] mx-auto"}>
      <div className={"space-y-[40px]"}>
        <div
          className="h-[40px] w-0 border-l-[1px] border-dashed border-blue-500 "
          // style="left: 5.8%"
        />

        {Accord.map((el, ix) => {
          return (
            <Accordion
              sequence={ix + 1}
              accordionId={el.id}
              title={el.title}
              className={"w-full"}
            >
              {el.content}
            </Accordion>
          );
        })}
      </div>
    </div>
  );
}

export default App;
